INSERT INTO `inventory` VALUES (34110, '75059', 'UNGER BROTHERS', '', 1, 'FLASK AND CIGARETTE CASE - 2-PIECE SET', 'cigarette case is monogrammed in large, shaded, Old English style: "ACM to JMR"', '0', '1750', '6 1/4" TAL (flask), 3 1/4" x 3 1/4" (case)', '-1', '0.HLWR75059.UNGERBROS.FLASK&CIGCASE.jpg', 'H', '0', 'n', '1', 'y', NULL, NULL, NULL, 1, 11, '', 16, '0.HLWR75059.UNGERBROS.DETAIL.jpg', '0.HLWR75059.UNGERBROS.MGM.jpg', 'From the latter 1800s until 1910, the Unger Brothers are noted for their production of remarkable silver items in the Art Nouveau style.  This matching cigarette case and liquor flask are a testament to this firms dazzling presence in the world of silver design.  Those sterling silver objects by Unger Bros. demonstrating their exceptional skill in the chasing of Art Nouveau motifs, such as waves, or flowing drapery and hair, have become highly collectible today. ', 'There were originally five Unger brothers associated with the firm at its founding in 1872, at first as manufacturers of pocketknives and hardware items.  In 1878 they began production of silver jewelry.  When three of the brothers died, Herman and Eugene Unger continued to run the business, Herman as silversmith, and Eugene as engraver.  In 1880 Eugene Unger married Emma  Dickinson, the daughter of Philemon Dickinson, who was largely responsible for the design of  the firms Art Nouveau wares.', 'By 1910 the last of the Ungers had died, and the Art Nouveau patterns had been retired.  At the inception of World War I in 1914, Unger Bros. ceased all production of silver articles to manufacture airplane parts.  The business was sold in 1919.....Compiled by IJP. Sources: Rainwater/Redfield 1998, Encyclopedia of American Silver Manufacturers Revised Fourth Edition; Fairbrothers 1997, Unger Bros. Newark, NJ 1872-1910.', '');
