INSERT INTO `inventory` VALUES (29333, '72740', 'WHITING', 'EGYPTIAN', 1, 'SOUP LADLE A/S', '', '0', '995', '', '1', '0.SRVPC72740.WHITING.SOUPLADLE.jpg', 'SP', '0', 'n', '1', '', NULL, '0', '0', 0, 9, '', 0, '0.SRVPC72740.WHITING.DETAIL1.jpg', '', 'As demonstrated by such patterns as Gorhams Isis, Lotus, and Egyptian, there was a marked use of Egyptian-inspired motifs in the American silver industry following 1869.  Egyptian Revival as a decorative style has waxed and waned since the time of the Roman Empire, but it was evidently the excitement surrounding the construction of the Suez Canal in 1867 that ignited the movement in silver flatware and holloware.  The Whiting Manufacturing Co. produced at least two such Egyptian Revival patterns, Lotus (remarkably similar in appearance to that of Gorham) and Egyptian, the latter shown here in the form of a soup ladle.', 'Whitings Egyptian, introduced c. 1870-75, features a pharaohs mask in relief flanked by stylized birds at the terminal end.  Along the handle are found a number of stylized papyrus clusters.  This pattern is scarcely found today...  Compiled by IJP.  Sources:  Hood/Curb/Olson Silver Magazine May/June & July/August 2003, American Silver Flatware in the Egyptian Revival Style    ', '', '');
