INSERT INTO `inventory` VALUES (29287, '72676', 'TIFFANY', 'ENGLISH KING', 1, 'SALAD SERVING SET 2-PIECE A/S', '', '0', '1800', '', '0', '0.SRVPC72676.TIFF.ENGKING-SALADSET.jpg', 'SP', '0', 'n', '1', '', NULL, '0', '0', 0, 9, '', 0, '0.SRVPC72676.TIFF.ENGKING-DETAIL1.jpg', '0.SRVPC72676.TIFF.ENGKING-DETAIL2.jpg', 'A design of Charles Grosjean, English King is a more conventional reproduction of typical eighteenth century French origin than the earlier Kings, or Saratoga.  English King is more correctly a Queens pattern, featuring a flower head between the mid-stem anthemia (honeysuckle motifs).  This style of flatware has been popular since its introduction, and countless makers have produced some version of Kings or Queens.', 'Grosjean acted as a designer and as superintendent of the silver manufactory at Tiffany & Co from about 1868 until his death in 1888.  His father, the elder Charles, of Grosjean & Woodward, was an eminent New York silversmith himself.  The younger Charles Grosjean has to his credit, in addition to English King, the patterns Lap Over Edge, Indian Chrysanthemum, and Wave Edge.  Curiously, Tiffany & Co. had apparently no trouble at all receiving a patent for English King in 1885, as strict a reinterpretation as it was of a traditional design.  When later the firm would try to patent their rendition of the fiddle-shell type, the patent office would deny them, citing its unoriginality... Compiled by IJP.  Sources:  Hood 1997, Tiffany Silver Flatware.', '', '');
