INSERT INTO `inventory` VALUES (28482, '69514', 'GORHAM', 'COLIGNI', 0, 'COMPLETE SET', '1 COMPLETE SET  148 PIECES: 11 DINNER KNIVES,   11 DINNER FORKS,12 LUNCHEON KNIVES,12 LUNCHEON FORKS,11 SALAD FORKS,11 TEASPOONS,11 DESSERT SPOONS,12 GUMBO SPOONS,10 COCKTAIL FORKS,10 BOUILLON SPOONS,11 FISH KNIVES (FLAT),10 BUTTER SPREADERS FH,7 GRAPEFRUIT SPOONS,4 DEMITASSE SPOONS,3 TABLESPOONS,1 CREAM/SAUCE LADLE,\r\n1 SUGAR TONG', '0', '13500', '', '1', '1.FLWR69514.COLIGNI.SET.jpg', 'FCS', '0', 'n', '1', '', NULL, '0', '0', 148, 10, '', 0, '1.FLWR69514.DETAIL.jpg', '1.FLWR69514.COLIGNI.SRVPCES.jpg', 'Comprising a total 148 pieces, this set of the rare Gorham pattern Coligni features at least seven different handle designs.  Designed by F. Antoine Heller, the impressive detail and subtlety of modeling leave no doubt as to the popularity and demand for his work in the 1880s.  Masterfully sculpted figures are rendered in a number of poses amidst a stylized background of arabesques.  They appear at times to represent scenes of provincial life, of women carrying baskets of fruit or sheaves of wheat, or leading their children, yet the cherubim and costume are definitely Classicist.  Did Heller, in seeking a vehicle through which to express his Classicist tendencies, choose for his theme the plight of the French expatriate Huguenots led by Admiral Gaspard de Coligni?', 'Florent Antoine Heller, born c. 1840 in the Alsatian town of Saverne, entered the silver trade amidst the academic classicism of the Beaux-Arts tradition.  In Paris, he absorbed the styles key values of precise detail and studied realism.  He had risen to some eminence as a silversmith and die-cutter when he was recruited by Edward C. Moore at Tiffany & Co. to collaborate on the flatware pattern Olympian (1878).  However, in 1880 Heller left Tiffanys to return to France.  When he was approached by Gorham Company, Moore attempted to win him back with offers of better pay, but Hellers mind was set.  At Gorham he received a very high salary.  To his credit are the flatware patterns Fontainebleau (1882); Medici and Cluny (1883); Nuremburg (1884);  Old Masters (1885); St. Cloud (1886); Versailles (1888); Coligni (1889); Marie Antoinette (1891); and Mythologique (1894).  As with many of Hellers designs, oxidation greatly enhances the appearance of Coligni, bringing out its subtle details..... Compiled by IJP. Sources: Hood 1999, Tiffany Silver Flatware; Carpenter 1982, Gorham Silver; Hood/Olson/Curb/Thompson 2002, Magazine Antiques.', '11 dinner Forks, 11 dinner knives, 12 lunch forks, 12 lunch knives, 11 salad forks, 11 teaspoons, 11 oval soup/dessert spoons, 12 gumbo spoons, 10 cocktail forks, 10 bouillon spoons, 11 fish knives, 10 flat-handled butter spreaders, 7 grapefruit spoons, 4 demitasse spoons, 3 tablespoons, 1 cream sauce ladle, 1 sugar tongs.\r\n', '');
