INSERT INTO `inventory` VALUES (28875, '70582', 'TIFFANY', 'OLYMPIAN', 1, 'ICE CREAM SERVER', 'monogrammed "FC" on back side', '0', '995', '9 1/4"', '1', '0.SRVPC70582.TIFF.OLYMP-ICECREAM.jpg', 'SP', '0', 'n', '1', '', NULL, '0', '0', 0, 9, '', 0, '0.SRVPC70582.TIFF.OLYMP-DETAIL.jpg', '', 'Masterfully executed by F. Antoine Heller, Olympian features the meticulous detail and subtlety of modeling, characteristic of the Academic Beaux-Arts style, which made Heller a valuable commodity in the last decades of the 19th Century.  Although Edward Moore is credited with its design, it is very possible that Heller at least had some influence.  This is the only Tiffany pattern bearing this Frenchman\'s touch.', 'Florent Antoine Heller, born 1839 in Saverne, France, plied his trade in Europe amidst a strong Academic and Classicist tradition.  Although there is no indication that he in fact attended the Ecole des Beaux-Arts, its artistic tenets are clearly evident in his work.  Olympian is surely exemplary of these tendencies.  The themes are drawn from classical mythology, while the precision and attention to the minutest detail are the quintessence of Academy.  There exist seventeen distinct handle designs in Olympian, depicting satyrs and bacchantes, the labors of Hercules, various gods and goddesses, and other mythological subjects.  In the scene on this serving piece, Orpheus searches for his wife Eurydice.  According to the myth, when Eurydice was killed by a snakebite, Orpheus descended into the Underworld with his lyre and played such beautiful music that Hades allowed her to be released...  Compiled by IJP.  Sources:  Hood 1999, Tiffany Silver Flatware; Carpenter 1997, Gorham Silver; The Owl at the Bridge, Gorham Roster of Craftsmen.', '', '');
