INSERT INTO `inventory` VALUES (33810, '74738', 'TIFFANY', 'SARATOGA', 1, 'SOUP LADLE A/S', '', '0', '995', '12"', '-1', '0.SRVPC74738.TIFF.SARA-SOUPLADLE.jpg', 'SP', '0', 'n', '1', '', NULL, NULL, '0', 1, 9, '', 0, '0.SRVPC74738.TIFF.SARA-DETAIL1.jpg', '', 'Introduced in 1870, Saratoga was patented that same year as Kings.  It has been called King, Old King, and Cook, before its reintroduction in 1956 by its current name.  An obsolete pattern, no pieces are made any longer, and it is not commonly found.    Designed by Edward Moore, it is a very liberal interpretation of the kings pattern-type.', 'Whereas the traditional form of kings typically displays a shell at the terminal, Moores rendition makes use of a dynamically stylized anthemion.  Such decorative honeysuckle devices make an appearance in the more conventional type, usually mid-stem, but here both the placement and abstraction are especially innovative, a trademark quality of Moore, and of Tiffany & Co. on the whole.   The pattern also incorporates scrolls and rosettes, and features a sleeker, more contemporary handle shape than its predecessors...  Compiled by IJP.  Sources:  Hood 1999, Tiffany Silver Flatware 1845-1905.', '', '');
