INSERT INTO `inventory` VALUES (34162, '75111', 'GORHAM', 'SAXON STAG', 1, 'SALT CELLAR SET 2-PIECE', 'TWO PIECE SET WITH BLUE GLASS LINERS\r\n\r\n#601', '6.17', '2950', '2 1/2" diameter x 2" tall', '0', 'HLWR75111.SALTCELLAR2.SAXONSTAG.jpg', 'H', '0', 'n', '1', '', NULL, NULL, NULL, 1, 11, '', 11, '0.HLWR75111.STAG.DETAIL1.jpg', '0.HLWR75111.STAG.DETAIL2.jpg', 'In 1855, Gorham & Co. introduced three new flatware patterns to its production.  Advances in manufacturing technologies had made it possible to produce quality wares in great quantities.  It was John Gorhams philosophy that, if machines could make production more efficient and ease the burden on his workers, the silversmiths would be able to better use their talents in the decoration and finishing of silver articles rather than simply their fabrication.  Among the first of these more elaborate patterns was Saxon Stag, also the most expensive of the 1855 patterns.  Items of holloware, such as this pair of salt cellars, were also made.', 'It was in fact John Gorham who was largely responsible for the mechanization of silver production in America, investigating European methods and modifying them to suit his needs.  As a result, articles of silver would no longer be limited to plain and simplistic forms, but rather could be made to be delightfully ornate. ', 'At this time in America, most makers were still producing in coin silver.  The sterling standard would not be adopted by Gorham until 1868.  Especially interesting to note are the marks found on these salt cellars.  The lion-anchor-G mark has been used continuously by Gorham since the 1850s at latest.  However, the precise arrangement of the marks may offer clues to the age of older items.  For a brief time (1850-65), some items were marked with a lion that appeared to be standing on its haunches.  Thus, this pair can be confidently placed very near the date of Saxon Stags first introduction in 1855... Compiled by IJP. Sources: Carpenter 1982 Gorham Silver 1831-1981 ', '');
