INSERT INTO `inventory` VALUES (34216, '75175', 'GORHAM', 'ISIS', 1, 'SUGAR & CREAMER', '#945D', '13.57', '2975', '4 3/8" (sugar), 3 5/8" (creamer)', '0', 'HLWR75175.CREAMERSUGAR.GORHAM.ISIS.jpg', 'H', '0', 'n', '1', '', NULL, NULL, NULL, 0, 11, '', 13, '0.HLWR75175.ISIS.S&CDETAIL1.jpg', '0.HLWR75175.ISIS.S&CDETAIL2.jpg', 'Throughout the 19th Century, contemporary Western culture became fascinated with the exotic civilizations of Ancient Egypt.  Napoleons campaigns in the region had led to marvelous archaeological discoveries, and scholars wrote volumes about their findings.  In Western decorative arts, this excitement revealed itself in numerous forms.  In America, however, it was not until the opening of the Suez Canal in 1867 that Egyptian decorative themes became prolific in the silver industry, and for a brief time in the 1860s and 1870s, silver in the Egyptian Revival style became very fashionable.  Among the most exotic of these are items in Gorhams pattern Isis.  Offered here are an open sugar bowl and creamer.', 'The primary decorative device of all pieces in Isis is the winged serpent applied to the handles of these pieces and found at the joint of handles to the functional ends of the patterns flatware pieces.  This motif bears resemblances to a symbol representative of Horus, who in Egyptian mythology was the son of Isis.', 'The date letter D puts the manufacture of this set at 1871.  As Egyptian Revival was a brief movement in silver design, holloware in this style is rare today.  The same eclecticism which made pieces such as this popular in the 1870s is valid today, and Isis continues all the more so to be a collectible pattern... Compiled by IJP. Sources: Hood/Curb/Olson Silver Magazine Sept/Oct 2003 "American Silver Flatware in the Egyptian Revival Style"; Carpenter 1982 Gorham Silver 1831-1981', '');
