INSERT INTO `inventory` VALUES (34342, '75311', 'GORHAM', 'MEDALLION', 0, 'PRESERVE SPOON', 'ENGRAVED "F"', '0', '485', '9"', '-1', 'SERV75311.PRESERVESPOON.MEDALLION.GORHAM.jpg', 'SP', '0', 'n', '1', '', NULL, NULL, NULL, 0, 9, '', 0, '0.SRVPC75311.GORHAM.MED-DETAIL1.jpg', '0.SRVPC75311.GORHAM.MED-DETAIL2.jpg', 'Among the many popular trends in 19th Century America, there arose the prolific use of the medallion as a decorative motif in silver flatware and holloware.  Over thirty such medallion patterns were created in sterling flatware alone.  One of the first was Medallion by Gorham, patented and introduced in 1864, and illustrated here by this preserve spoon.  Its designer was the esteemed George Wilkinson, who acted as chief designer at Gorham from 1860 to 1891.  His Medallion pattern, like others, makes use of a cameo image within a round medallion element.  These sculptural profiles are frequently lifted directly from antique and Classical history, and were very often faithfully reproduced from standard portraits of ancient statuary in Victorian illustrations.', 'Wilkinsons new and original design, in his very own words, incorporated a shaft or longitudinal feature of the handle, the outline of which increases in width gradually from the bowl to the top or extremity which terminates in an abrupt curve...  This curve is ornamented and partially concealed by the ornamental scroll strap work...  beneath which is situated a round medallion.  Midway down the handle stem is an oval rosette.  The result is distinct features which are combined and incorporated to produce a highly ornamental effect (Letters Patent No. 1952, dated June 7, 1864).', 'On the preserve spoon here displayed, the medallion device encircles a profile portrait of Mars, the Roman god of war and the protector of Rome.  Not all of the medallion portraits in Gorhams Medallion have been positively identified.  Note the precise modeling of the head and its accoutrements, and the strength of its presence against the textured background...  Compiled by IJP.  Sources:  Soeffing 1988, Silver Medallion Flatware; Carpenter 1997, Gorham Silver.', '');
