INSERT INTO `inventory` VALUES (34383, '75355', 'REED & BARTON', 'LOUIS XV', 1, 'BREAD & BUTTER PLATE', '#712 C  ', '0', '365', '', '0', 'HLWR75355.AGNES.RB.BBPLATE.1.jpg', 'H', '0', '', '1', '', NULL, NULL, NULL, 0, 11, '', 3, '', '', '', '', '', '');
INSERT INTO `inventory` VALUES (34380, '75352', 'REED & BARTON', 'LOUIS XV', 1, 'COFFEE POT', '#712 C ', '0', '2500', '', '0', 'HLWR75352.AGNES.COFFEEPOT.jpg', 'H', '0', 'n', '1', '', NULL, NULL, NULL, 0, 11, '', 13, '', '', 'Reed & Barton, of Taunton, Massachusetts, has remained a family-managed company since its very founding.  In 1835 Henry Reed and Charles E. Barton worked to salvage the failing Taunton Britannia Manufacturing Co.  This would ultimately become Reed & Barton, which has survived hardship, depression, and the threat of take-over to become the oldest independent silver manufacturer in America...  Compiled by IJP.  Sources:  Rainwater 1998, Encyclopedia of American Silver Manufacturers; Carpenter 1997, Gorham Silver .', '', '', '');
