INSERT INTO `inventory` VALUES (34395, '75366', 'REED & BARTON', 'LOUIS XV', 1, 'SUGAR BOWL', '#712 C  ', '0', '1500', '', '0', 'HLWR75366.AGNES.SUGARBOWL.jpg', 'H', '0', '', '1', '', NULL, NULL, NULL, 0, 11, '', 13, '', '', '', '', '', '');
INSERT INTO `inventory` VALUES (34397, '75368', 'GORHAM', '', 1, 'VASE', '#1450  1960 year mark', '17.1', '825', '10 1/4"', '0', '0.HLWR75368.GORHAM.VASE.jpg', 'H', '0', 'n', '1', '', NULL, NULL, NULL, 0, 11, '', 1, '', '', 'Gorham Vase, circa 1960.  Although no drastic changes in silver design occurred after World War II, there was a continuing trend in the production of more contemporary and stream-lined wares.  By 1960, there had grown a demand for pieces in a more modern style.  Many of Gorhams older designers were content to adhere to tradition and reluctant to embrace the new vogue, so the company began to hire promising younger men and women to rejuvenate its look.  Among such designers was Burr Sebring, who would later become Gorhams Director of Design (1973)...  Compiled by IJP.  Sources:  Carpenter 1997, Gorham Silver (revised); The Owl at the Bridge, Roster of Craftsmen.', '', '', '');
