INSERT INTO `inventory` VALUES (34643, '75755', 'TOWLE', 'POMONA', 1, 'COMPLETE SET', '12 KNIVES 9"\r\n12 FORKS 7 3/8"\r\n12 TEASPOONS 5 7/8"\r\n11 SHERBERT SPOONS 5 3/8"\r\n12 5 O\'CLOCK SPOONS 5 1/2"\r\n12 COCKTAIL FORKS 6 1/8"\r\n8 DEMITASSE SPOONS 4 1/2"\r\n12 OVAL SOUP SPOONS 7"\r\n6 GRAPEFRUIT SPOONS 5 1/2"\r\n4 TABLESPOONS 8"\r\n1 COLD MEAT FORK 7 1/2"\r\n1 CHEESE SCOOP 6 1/2"\r\n1 CREAM/SAUCE LADLE 6"\r\n1 SUGAR SIFTER 6"\r\n1 BERRY SPOON 8 3/4"\r\n1 ICE CREAM SERVER 9"\r\n1 ICE CREAM KNIFE 11 1/4"\r\n1 SUGAR TONG 5 1/4"\r\n2-PIECE OLIVE SET 8 1/2"\r\n1 LETTUCE FORK 8 3/4"\r\n1 BUTTER PICK 6 1/4"\r\n1 MUSTARD LADLE 5 1/4"\r\n2 MASTER SALT SPNS 3 1/2"\r\n1 SOUP LADLE 12"', '0', '13500', '', '0', '0.FLWR75755.TOWLE.POMONASET.jpg', 'FCS', '0', 'n', '1', '', NULL, NULL, NULL, 109, 10, '', 0, '0.FLWR75755.TOWLE.POMONASET2.jpg', '', 'Comprising 117 total pieces, this set includes a versatile array of serving implements.  Named for the Roman goddess of fruits and gardens, Pomona was introduced in 1881 by the A. F. Towle & Son Co. of Newburyport, Massachusetts.  It coincided with several other multi-motif patterns in the 1870s and 80s featuring fruit themes.  Many of these patterns exhibit a naturalistic Japanesque aesthetic, characteristic in these decades following Commodore Matthew Perrys 1854 expedition and the opening of trade and communication with Japan.', 'The Towle Silversmiths rich history begins with the Moulton silversmiths descended from William Moulton II, born in Newburyport, 1664.  Anthony F. Towle and William P. Jones, both apprentices to William IV, entered into the Towle & Jones partnership in 1857.  In 1873 Towles son Edward F. joined his father to form A. F. Towle & Son.  At their retirement in 1882, the Towle Mfg. Co. was formed.  This set includes:  12 knives (9), 12 forks (7 3/8), 12 teaspoons (5 7/8), 11 sherbet spoons (5 3/8), 12 five oclock spoons (5 ), 12 cocktail forks (6 1/8), 8 demitasse spoons (4 ), 12 oval soup spoons (7), 6 grapefruit spoons (5 ),  4 tablespoons (8), 1 cold meat fork (7 ), 1 cheese scoop (6 ), 1 cream/sauce ladle (6), 1 sugar sifter (6), 1 berry spoon (8 ), 1 ice cream server (9), 1 ice cream knife (11 ), 1 sugar tong (5 ), 2-piece olive set (8 ), 1 lettuce fork (8 ), 1 butter pick (6 ), 1 mustard ladle (5 ), 2 master salt spoons (3 ), and 1 soup ladle (12)...  Compiled by IJP.  Sources:  Rainwater 1998, Encyclopedia of American Silver Manufacturers; Hood/McGrew/Curb/Szaro, The Berry Silver Flatware Pattern by Whiting Silver Magazine Sept/Oct 2004.', '', '');
