INSERT INTO `inventory` VALUES (34832, '76006', 'HYDE & GOODRICH', '', 1, 'COFFEE POT', 'Hyde & Goodrich  N.O. E&S  COIN', '40.75', '4200', '12 1/2" tall', '0', '0.HLWR.COFFEEPOT.H&G2.jpg', 'H', '0', 'n', '1', '', NULL, NULL, NULL, 0, 11, '', 13, '0.HLWR76006.H&G.MARKS.jpg', '0.HLWR76006.H&G.HANDLE.jpg', 'Made by New York silversmiths Eoff & Shepherd for the noted New Orleans retailer Hyde & Goodrich, this coin silver coffeepot exhibits many elements of the Rococo Revival style popular in the mid-19th century.  The body of the coffeepot is liberally embellished with scrolls, while the handle and spout are formed as naturalistic tree branches.  The whole of the work carries meticulously placed details of leaves, flowers, and vines, from the fancifully crafted feet to the modest flower bud at its finial.  All of these features are exemplary of the Rococo Revival movement.', 'Garret Eoff was active in New York during the first half of the 1800s, and his name can be connected with that of several contemporary silversmiths.  Eoff had already been in the silver-working trade for thirty years when he joined with John Chandler Moore in 1835, rather early in the latter\'s career.  Moore would later become the most prominent silversmith in New York, closely associated with the prestigious firm Tiffany & Co.  The partnership of Eoff and Shepherd can be placed circa 1850.', 'Hyde & Goodrich traces its roots to circa 1815.  Until the time of the Civil War, it provided jewelry, watches, pistols, and gold and silver wares to consumers in New Orleans.  The firm worked closely with silversmiths Kuchler & Himmel, and later with Adolphe Himmel alone, who agreed to make silverwares exclusively for the firm.  These items are very much sought after today.....Compiled by IJP.  Sources: Green 1984, Marks of American Silversmiths Revised (1650-1900); Historic New Orleans Collection 1980, Crescent City Silver  ', '');
