INSERT INTO `inventory` VALUES (34849, '76026', 'ERNST DRAGSTED', '', 1, 'ICE SPOON', 'Ernst Dragsted was an active silversmith between 1920 and 1950 in Copenhagen, Denmark.  He descended from Arent Dragsted, a royal court jeweler & goldsmith at the end of 19th Century.  The Dragsted family business began in 1854.  Between 1915 and 1920 the company split to pursue separate goals, at which time Ernst Dragsted pursued the art of silversmithing.  This ice spoon is a classic example of Danish silversmithing adorned with a blossom handle and prominent hand hammering.', '0', '1200', '9 3/4"', '0', '0.SRVPC76026.Dragstedspoon.jpg', 'SP', '0', 'n', '1', '', NULL, NULL, NULL, 0, 9, '', 0, '', '', 'Ernst Dragsted was an active silversmith between 1920 and 1950 in Copenhagen, Denmark.  He descended from Arent Dragsted, a royal court jeweler & goldsmith at the end of 19th Century.  The Dragsted family business began in 1854.  Between 1915 and 1920 the company split to pursue separate goals, at which time Ernst Dragsted pursued the art of silversmithing.  This ice spoon is a classic example of Danish silversmithing adorned with a blossom handle and prominent hand hammering.', '', '', '');
