INSERT INTO `inventory` VALUES (35019, '76198', 'JOSEPH ANGELL', '', 1, 'MEAT DOME AND TRAY', '', '175.9', '16500', '24" x 15 1/2" x 15" tall', '0', '0.HLWR76198.ANGELL.MEATDOME.jpg', 'H', '0', 'n', '1', '', NULL, NULL, NULL, 0, 11, '', 12, '0.HLWR76198.ANGELL.DETAIL.jpg', '0.HLWR76198.ANGELL.ENGRAVING.jpg', 'Measuring 24 inches in length and over 15 inches wide, this meat dome consists of a sterling well-and-tree platter and a Sheffield-plate base and cover.  It was crafted circa 1820 by Joseph Angell, an important early 19th century London silver- and goldsmith.  In fact, the Angell family name would remain eminent in the silver trade throughout the 1800\'s.  ', 'The Rococo ornamentation is very typical of its time.  Around the perimeter of the platter is a luxurious border of roses, chrysanthemums, acanthus leaves, and C-scrolls along a pleated ribbon backdrop.  This theme is repeated around the top of the dome lid.  The acanthus and scrolls reappear in the handles and feet.', 'Most interesting about this piece are the engraved crests found on the platter and lid, featuring two shields wrapped in laurel leaves.  Around one of these shields is inscribed, "Tria Juncta In Uno" (Latin: Three joined as one), the motto of the Order of the Bath, one of England\'s highest orders of chivalry.  Below this, a banner reads, "Ich Dien" (German: I serve), a phrase which appears on the military badges of members of this Order.  A Star of the Knights Grand Cross is suspended from that banner.  Below all of this, a banner reads, "Fidelle A Mon Roi" (Faithful to My King).  In heraldic terms, the leftmost shield is divided per fess (that is, divided horizontally, top and bottom) by an embattled line.  In the upper portion is what appears to be a circular arrangement of laurel leaves crossed by pennants.  At dexter (the left side as seen by the viewer) may be a crown or tower.  The lower portion is a field of ermine, in the middle of which is a rose or rose double.  The shield at the right exhibits these same elements, but it is also divided per pale (vertically, left and right), the dexter per fess.  At sinister (the viewer\'s right) is a lion rampant.....Compiled by IJP.  Sources: Pickford 1991, Jackson\'s Hallmarks; Debretts, http://www.debretts.co.uk/etiquette/order_of_the_bath.html; Velde 2003, www.heraldica.org  ', '');
