INSERT INTO `inventory` VALUES (35220, '76419', 'GORHAM', '', 1, 'WATER PITCHER', '#220  - Engraved with "Presentado of Sr. Don Carlos de Bolton Consul y comisionado Imperial de Austria por sus agradecidos...  Habana, Mayo 1863... Amigos" - (Gorham coin silver)', '50.56', '6800', '12" tall', '-1', '0.HLWR76419.GORHAM.H2OPITCHER.jpg', 'H', '0', 'n', '1', '', NULL, NULL, NULL, 0, 11, '', 10, '0.HLWR76419.GORHAM.DETAIL2.jpg', '', 'The Gorham Manufacturing Co. traces its roots to the jeweler Jabez Gorham, who began to make coin silver spoons in 1831.  It was his son John Gorham who was largely responsible for the rapid expansion of the company, and its prominence in the silver industry today.   In the early 1850s, Gorham & Thurber, as the company was then called, began to manufacture holloware.  John Gorham began to see a need for more efficient manufacturing techniques, as well as for skilled workers, and travelled to Europe both to investigate silverworking methods and to recruit silversmiths, chasers, engravers, and other skilled individuals.  By the mid-1850s, Gorham & Co. was producing holloware of exceptionally high quality and in the latest tastes.', 'The use in silver design of cast heads of animals, such as stags or rams, and the engraving of strapwork or bands, was very popular during the 1850s and 60s, and typical of the Renaissance Revival style.  This pitcher is more strictly Renaissance Revival than some other holloware items of the day, many of which would be described as High Victorian, an eclectic style including motifs from Rococo and Classicist sources as well as the Renaissance.  It is certainly a spectacular example of the fine work in coin silver that preceded Gorhams decision in 1868 to produce wares in sterling...  Compiled by IJP.  Sources:  Carpenter 1997, Gorham Silver (Revised).   ', '', '');
