INSERT INTO `inventory` VALUES (35727, '76942', 'TOWLE', 'MARY CHILTON', 1, 'BON BON / NUT SPOON', '', '0', '45', '4 3/4"', '0', '', 'sp', NULL, '', '1', NULL, NULL, NULL, NULL, 0, 9, '', 0, '', '', '', '', '', '');
INSERT INTO `inventory` VALUES (35728, '76943', 'HOTCHKISS & SCHREUDER', '', 1, 'FISH SLICE', '', '0', '525', '10 5/8"', '-1', '0.SRVPC76943.H&S.FISHSLICE.jpg', 'SP', '0', 'n', '1', '', NULL, NULL, NULL, 0, 9, '', 0, '0.SRVPC76943.H&S.FISHSLICE-DETAIL2.jpg', '', 'Based in Syracuse, New York, Hotchkiss & Schreuder was active 1857-1871.  The firm succeeded Bunnelle & Schreuder, and would later be itself succeeded by the Syracuse Silver Manufacturing Co., then by Lesser & Rheinauer.  David Hotchkiss began as a silversmith in Palmyra c. 1840, and Andrew B. Schreuder in Utica c. 1851.  This particular fish slice bears marks dating it between 1857-1864.  Although by this time a few American manufacturers had chosen to upgrade to the sterling standard to compete with the English market, most continued for several more years to produce coin silver items such as this.', 'A relevant series of catalog clippings was discovered amongst the Gorham archives, including a page from the Syracuse Silver Manufacturing Co.  This document illustrated a number of patterns originating with Hotchkiss & Schreuder, such that many patterns, previously known only by description, could be assigned their proper names.  Sadly, this pattern was not identified on that page.  However, there do appear to be extant variations of this handle type by the firm.  At least one such piece included an engraved medallion-style design at the obverse handle terminal.  \r\nNote especially on this piece the intricate engraving on the functional end...  Compiled by IJP.  Sources:  Rainwater/Redfield 1998, Encyclopedia of American Silver Manufacturers Revised Fourth Edition; Soeffing 1988, Silver Medallion Flatware; Soeffing/Silver Magazine Jan/Feb 1991, More Syracuse SilverThe Patterns of Hotchkiss & Schreuder and Their Predecessors and Successors.      \r\n \r\n', '', '');
