INSERT INTO `inventory` VALUES (35882, '77109', 'GEORG JENSEN', 'PYRAMID', 1, 'NAPKIN RINGS-SET OF 10', '#22A  HN (Harald Nielson)  STERLING  DENMARK', '11.9', '2000', '2 1/8" x 1 1/4"', '0', '0.HLWR77109.JENSEN.NAPRINGS.jpg', 'H', '0', 'n', '1', '', NULL, NULL, NULL, 0, 11, '', 8, '', '', 'Designed by Harald Nielsen, Pyramid is among the more Art Deco of the Georg Jensen patterns.  Its superimposed geometric forms lend harmony to the pieces, but are not visually overpowering, very much according to Nielsens own artistic philosophy.  Its introduction in 1927 closely followed the 1923 excavations of Tutankhamuns tomb.  Harald Nielsen began to work for Jensen in 1909 as an apprentice engraver and chaser, but his drafting and designing talents soon brought him prominence with the firm.  After Georg Jensens death in 1935, Nielsen assumed the role of artistic director.  ', '', '', '');
